import logoMesto from "../images/logo.svg";
import { Routes, Route, Link } from 'react-router-dom';

function Header() {
  return (
    <header className="header">
      <img className="header__logo" src={logoMesto} alt="Логотип сайта" />
    </header>
  );
}

export default Header;
